import React from "react";
import GoogleIcon from "@mui/icons-material/Google";
import FacebookIcon from "@mui/icons-material/Facebook";
import InstagramIcon from "@mui/icons-material/Instagram";
import TwitterIcon from "@mui/icons-material/Twitter";
import "./Footer.scss";

function Footer() {
  return (
    <div className="footer">
      <div className="footer__left">
        <h1>APPS</h1>
        <div className="footer__nav">
          <li>PRODUCTS</li>
          <li>NEWS</li>
          <li>CONTACT</li>
          <li>YOUR CART</li>
        </div>
      </div>

      <div className="footer__right">

        <div className="footer__icons">
          <GoogleIcon className ='footer__icon' fontSize="large" />
          <FacebookIcon className ='footer__icon' fontSize="large" />
          <InstagramIcon className ='footer__icon' fontSize="large" />
          <TwitterIcon className ='footer__icon' fontSize="large" />
        </div>

    <div className="footer__copy">
        <h4>Privacy Policy</h4>
        <h4>&#169; 2017. Google All Rights Reserved</h4>
    </div>
      </div>
    </div>
  );
}

export default Footer;
